import { useState } from 'react'

export default function Index() {

  const [lists, setLists] = useState([{title: "dsa"}])
  return (
    <div
    onClick={ () => console.log(lists)}
    >
      <p>Hello Next.js</p>
      <NewList lists={lists} setLists={setLists}/>
      {lists.map(item)}

    </div>
  )
}
